import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";
import { Navbar, Nav, Image, Form, FormControl, Button, NavDropdown} from 'react-bootstrap';
import Login from '../Login/Login';
import { FaSearch } from 'react-icons/fa';
import './NavBar.css';
import Home from '../Home/Home';

import { generatePath } from "react-router";

function NavBar() {

  var models= ["Spaces", "Subspace", "Survey", "Section", "Question", "Answer"]

  function createDropDown_Routes(){
    var dropDownRows= []
    var routesRows= []
    for (var model of models){
      var href= generatePath("/Add/:entity", {
        entity: model
      });
      var str= "Add_".concat(model)
      dropDownRows.push(<NavDropdown.Item key={model} href={href}>{model}</NavDropdown.Item>)
      routesRows.push(
        <Route path={href}>
            <Login type= {str}></Login>
        </Route>
      )
    }
    return [dropDownRows, routesRows]
  }
    var rows= createDropDown_Routes()
    var dropDownRows= rows[0]
    var routesRows= rows[1]
    return (
        <Router>
            <Navbar bg="light" variant="light">
                <Navbar.Brand href="/home">
                    <Image className="img" src="octoLogo.png" />
                </Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav" >
                    <Nav className="mr-auto">
                      <NavDropdown title="Add" id="basic-nav-dropdown">
                        {dropDownRows}
                      </NavDropdown>
                        <Nav.Link href="/Spaces" className="links">Browse spaces</Nav.Link>
                        <Nav.Link href="/" className="links">Teams</Nav.Link>
                        <Nav.Link href="/" className="links">Profile</Nav.Link>
                    </Nav>
                    <Nav className="justify-content-end" >
                        <Nav.Link href="/" className="links">Help</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>

            <Switch>
                <Route path="/home" >
                    <Home></Home>
                </Route>
                <Route path="/Spaces">
                    <Login type= "Spaces" ></Login>
                </Route>
                {routesRows}
            </Switch>
        </Router>
    )
}

export default NavBar
